“Back in April we realized it was time to postpone our dream wedding until 2021. We both agreed we couldn’t let our original wedding date go by without making it official. My original rehearsal dinner gown quickly became my wedding gown, my mother and godmothers wedding China and silver became our table setting, and my childhood home became our wedding venue. The same home my parents brought me home to from the hospital when I was born, where me and my two brothers were raised, where I got ready for my first days of school, and the same home were my family met Marc for the first time about 5 years ago. It was without a doubt the most special wedding day at home with our loved ones that could be with us. In a time when world seems upside down it truly made us realize what’s important in life and gave us the most unexpected yet meaningful wedding day of all time. How lucky are we to be able to celebrate our wedding day twice, with two different weddings. We can’t wait to do it all over again in 2021 but until then there is one thing I know for sure- there is no place like home.”";}i:69;a:1:{s:14:"comments_count";i:1;}i:70;a:1:{s:11:"likes_count";i:3;}i:71;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEu2maWDNwV";}i:72;a:1:{s:5:"image";s:238:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/118887703_115519510123234_2134149616101619353_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=110&_nc_ohc=s_ex21i0DJQAX9JldbF&oh=e44f38036fe48bbb1505df59e93238df&oe=5F7AC4BC";}i:73;a:1:{s:4:"type";s:5:"image";}i:74;a:1:{s:8:"owner_id";i:10416330016;}i:75;a:1:{s:14:"owner_username";s:0:"";}i:76;a:1:{s:14:"owner_fullname";s:0:"";}i:77;a:1:{s:9:"owner_pic";s:0:"";}i:78;a:1:{s:2:"id";s:19:"2391088578972059213";}i:79;a:1:{s:10:"short_code";s:11:"CEu2mTgH4ZN";}i:80;a:1:{s:12:"created_time";i:1599259992;}i:81;a:1:{s:7:"caption";s:220:"Bridesmaid vibes ❤️💃🏽
